import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 60.2-218 Employment taxed by federal law.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/60.2-218.md","filePath":"vacode/60.2-218.md"}'),o={name:"vacode/60.2-218.md"},c=r('<h1 id="§-60-2-218-employment-taxed-by-federal-law" tabindex="-1">§ 60.2-218 Employment taxed by federal law. <a class="header-anchor" href="#§-60-2-218-employment-taxed-by-federal-law" aria-label="Permalink to &quot;§ 60.2-218 Employment taxed by federal law.&quot;">​</a></h1><p>Notwithstanding any other provision of §§ <a href="http://law.lis.virginia.gov/vacode/60.2-212/" target="_blank" rel="noreferrer">60.2-212</a> through <a href="http://law.lis.virginia.gov/vacode/60.2-217/" target="_blank" rel="noreferrer">60.2-217</a> and § <a href="http://law.lis.virginia.gov/vacode/60.2-219/" target="_blank" rel="noreferrer">60.2-219</a>, the term &quot;employment&quot; shall mean service with respect to which a tax is required to be paid under any federal law imposing a tax against which credit may be taken for taxes required to be paid into a state unemployment fund or which as a condition for full tax credit against the tax imposed by the Federal Unemployment Tax Act is required to be covered under this title.</p><p>Code 1950, § 60-14; 1952, cc. 30, 184; 1956, c. 440; 1962, c. 71; 1968, c. 738, § 60.1-14; 1971, Ex. Sess., c. 235; 1972, c. 824; 1974, cc. 466, 660; 1976, c. 304; 1977, c. 330; 1979, c. 637; 1980, cc. 520, 522; 1981, cc. 28, 369, 374, 375; 1982, c. 25; 1983, c. 14; 1984, cc. 120, 139, 204; 1985, cc. 152, 254; 1986, c. 480.</p>',3),i=[c];function n(l,d,s,h,p,_){return a(),t("div",null,i)}const u=e(o,[["render",n]]);export{f as __pageData,u as default};
